import React from 'react';
import logo from '../logo.svg';

const Resume = () => {
	return (
		<div>
                <h1>
                Edit your life and save to reload.
                </h1>
                <a
                className="App-link"
                href="https://reactjs.org"
                target="_blank"
                rel="noopener noreferrer"
                >
                Learn React Resume
                </a>
        </div>
	);
};

export default Resume;
